class Dok:
    def __init__(self, type, identy, info, text):
        self.type = type
        self.identy = identy  #tипа qr
        self.info = info   #типо ФИО
        self.text = text

    def display(self):
        print(self.type)
        print(self.identy)
        print(self.info)
        print(self.text)

    def full(self):
        self.text += input()
        print(self.text)
class Invoice(Dok):
    def __init__(self, prod):
        super().__init__("Receipt", "0101", "Чек на выписку об транзакции, банк Сбирбэнк", "")
        self.prod = prod  # чек как магазине

    def chek(self):
        while True:
            a = self.prod + input() + "\n"
            if a == self.prod + "stop":
                break
            else:
                self.prod = a
        return self.prod
class Receipt(Invoice):
    def __init__(self, date):
        super().__init__("BankAcc", "0102", "Перевод денежных средств", "", input())
        self.date = date
    def time(self):
        self.date = int(input("Введите дату подписания договора:"))
        return self.date

class BankAcc(Dok):
    def __init__(self, name = ""):
        super().__init__("BankAcc", "0102", "Перевод денежных средств", "")
        self.name = name

    def information(self):
        self.name = list(map(lambda x: x.upper(),input("Введите ФИО:").split(" ")))
        return self.name


